const ArvoRegular = `@font-face { font-family: 'Arvo'; font-style: normal; font-weight: 400; src: local('Arvo'), url('data:font/woff2;base64,') format('woff2'); }`;
const Arvo700 = `@font-face { font-family: 'Arvo'; font-style: normal; font-weight: 700; src: local('Arvo Bold'), local('Arvo-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const ArvoItalic = `@font-face { font-family: 'Arvo'; font-style: italic; font-weight: 400; src: local('Arvo-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Arvo700italic = `@font-face { font-family: 'Arvo'; font-style: italic; font-weight: 700; src: local('Arvo Bold Italic'), local('Arvo-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
